// page init
jQuery(function(){
	jcf.customForms.replaceAll();
	initTabs();
	initTouchNav();
	initOpenClose();
	initAccordion();
	initCycleCarousel();
	initLightbox();
	initDropDown();
	initSameHeight();
	initCustomHover();
	initTextChange();
	jQuery('input, textarea').placeholder();
});

// cycle scroll gallery init
function initCycleCarousel() {
	jQuery('div.cycle-gallery').scrollAbsoluteGallery({
		mask: 'div.mask',
		slider: 'div.slideset',
		slides: 'div.slide',
		btnPrev: 'a.btn-prev',
		btnNext: 'a.btn-next',
		pagerLinks: '.pagination li',
		stretchSlideToMask: true,
		maskAutoSize: true,
		autoRotation: false,
		switchTime: 3000,
		animSpeed: 500
	});
}

// content tabs init
function initTabs() {
	jQuery('ul.tabset-01').contentTabs({
		parentBlock: '.open-close-02',
		tabLinks: 'a'
	});
	jQuery('ul.tabset-02').contentTabs({
		parentBlock: '.open-close-03',
		tabLinks: 'a',
		effect: 'fade',
		extFlag: true
	});
}

// init text change
function initTextChange () {
	jQuery('.tab-page').each(function() {
		var holder = jQuery(this);
		if (!holder.length) {
			return;
		}
		var openHold = holder.find('.open-close-03');
	});
}

// animated navigation init
function initDropDown() {
	var win = jQuery(window);
	var nav = jQuery('#nav ul');
	var items = nav.children('li');
	var drop = nav.find('ul');
	var winWidth;
	var resizeFlag = false;
	var resizeFlag2 = false;
	calcWinWidth();
	win.on('resize', calcWinWidth);
	function calcWinWidth () {
		winWidth = win.outerWidth();
		if (winWidth < 768 && !resizeFlag) {
			items.each(function () {
				var item = jQuery(this),
					dropWrap = item.find('.drop-slide-wrapper'),
					drop = item.find('ul');
				item.removeAttr('class');
				drop.removeAttr('style').appendTo(item);
				item.unbind(window.TouchNav && TouchNav.isActiveOn(this) ? 'itemhover' : 'mouseenter').unbind(window.TouchNav && TouchNav.isActiveOn(this) ? 'itemleave' : 'mouseleave');
				if (dropWrap.length) {
					dropWrap.remove();
				}
			});
			
			jQuery('#nav ul').animDropdown({
				items: 'li',
				drop: '>ul',
				animSpeed: 400,
				effect: 'slide'
			});
			resizeFlag = true;
			resizeFlag2 = false;
		} 
		if (winWidth >= 768 && !resizeFlag2) {
			items.each(function () {
				var item = jQuery(this),
					dropWrap = item.find('.drop-slide-wrapper'),
					drop = item.find('ul');
				item.removeAttr('class');
				drop.removeAttr('style').appendTo(item);
				item.unbind(window.TouchNav && TouchNav.isActiveOn(this) ? 'itemhover' : 'mouseenter').unbind(window.TouchNav && TouchNav.isActiveOn(this) ? 'itemleave' : 'mouseleave');
				if (dropWrap.length) {
					dropWrap.remove();
				}
			});
		 	jQuery('#nav ul').animDropdown({
				items: 'li',
				drop: '>ul',
				animSpeed: 400,
				effect: 'fade'
			});
			resizeFlag2 = true;
			resizeFlag = false;
		 } 
	}
}

// open-close init
function initOpenClose() {
	jQuery('div.open-close-02').openClose({
		hideOnClickOutside: true,
		activeClass: 'active',
		opener: '.opener-02',
		slider: '.slide-02',
		animSpeed: 400,
		effect: 'slide'
	});
	jQuery('div.open-close').openClose({
		hideOnClickOutside: true,
		activeClass: 'active',
		opener: '.opener',
		slider: '.slide',
		animSpeed: 400,
		effect: 'slide'
	});
	jQuery('div.open-close-03').openClose({
		hideOnClickOutside: true,
		activeClass: 'active',
		opener: '.opener-04',
		slider: '.slide-03',
		animSpeed: 400,
		effect: 'slide'
	});
}

// accordion menu init
function initAccordion() {
	jQuery('ul.accordion-01').slideAccordion({
		opener: 'a.opener-01',
		slider: 'div.slide-01',
		animSpeed: 300
	});
	jQuery('div.four-columns').slideAccordion({
		opener: 'h3.opener-03',
		slider: 'div.slide-02',
		animSpeed: 300
	});
}

// fancybox modal popup init
function initLightbox() {
	jQuery('a.lightbox, a[rel*="lightbox"]').each(function(){
		var link = jQuery(this);
		link.fancybox({
			padding: 10,
			margin: 0,
			cyclic: false,
			autoScale: true,
			overlayShow: true,
			overlayOpacity: 0.75,
			overlayColor: '#000000',
			titlePosition: 'inside',
			onComplete: function(box) {
				if(link.attr('href').indexOf('#') === 0) {
					jQuery('#fancybox-content').find('a.close').unbind('click.fb').bind('click.fb', function(e){
						jQuery.fancybox.close();
						e.preventDefault();
					});
				}
			}
		});
	});
}

/* Fancybox overlay fix */
jQuery(function(){
	// detect device type
	var isTouchDevice = ('ontouchstart' in window) || window.DocumentTouch && document instanceof DocumentTouch;
	var isWinPhoneDevice = navigator.msPointerEnabled && /MSIE 10.*Touch/.test(navigator.userAgent);

	if(!isTouchDevice && !isWinPhoneDevice) {
		// create <style> rules
		var head = document.getElementsByTagName('head')[0],
			style = document.createElement('style'),
			rules = document.createTextNode('#fancybox-overlay'+'{'+
				'position:fixed;'+
				'top:0;'+
				'left:0;'+
			'}');

		// append style element
		style.type = 'text/css';
		if(style.styleSheet) {
			style.styleSheet.cssText = rules.nodeValue;
		} else {
			style.appendChild(rules);
		}
		head.appendChild(style);
	}
});

// align blocks height
function initSameHeight() {
	jQuery('div.three-columns').sameHeight({
		elements: 'div.heading',
		flexible: true,
		multiLine: true
	});
}

// handle dropdowns on mobile devices
function initTouchNav() {
	jQuery('#nav ul').each(function(){
		new TouchNav({
			navBlock: this
		});
	});
}

// add classes on hover/touch
function initCustomHover() {
	jQuery('.img-box').touchHover();
}

